    "strategyCode": "# -- Original Hybrid --\nclass RegimeRouterHybrid(Strategy):\n    name = \"regime_router\"\n    family = \"hybrid\"\n    description = \"Routes to best champion per regime bucket\"\n\n    ROUTING = {\n        ('ASIA', 'CONSOLIDATION', 'HIGH_VOL'): 'volume',\n        ('ASIA', 'CONSOLIDATION', 'LOW_VOL'): 'momentum',\n        ('ASIA', 'DOWNTREND', 'HIGH_VOL'): 'momentum',\n        ('ASIA', 'DOWNTREND', 'LOW_VOL'): 'trend',\n        ('ASIA', 'UPTREND', 'HIGH_VOL'): 'trend',\n        ('ASIA', 'UPTREND', 'LOW_VOL'): 'trend',\n        ('LONDON', 'CONSOLIDATION', 'HIGH_VOL'): 'volume',\n        ('LONDON', 'CONSOLIDATION', 'LOW_VOL'): 'volume',\n        ('LONDON', 'DOWNTREND', 'HIGH_VOL'): 'volatility',\n        ('LONDON', 'DOWNTREND', 'LOW_VOL'): 'trend',\n        ('LONDON', 'UPTREND', 'HIGH_VOL'): 'volatility',\n        ('LONDON', 'UPTREND', 'LOW_VOL'): 'momentum',\n        ('NY', 'CONSOLIDATION', 'HIGH_VOL'): 'trend',\n        ('NY', 'CONSOLIDATION', 'LOW_VOL'): 'trend',\n        ('NY', 'DOWNTREND', 'HIGH_VOL'): 'trend',\n        ('NY', 'DOWNTREND', 'LOW_VOL'): 'volume',\n        ('NY', 'UPTREND', 'HIGH_VOL'): 'trend',\n        ('NY', 'UPTREND', 'LOW_VOL'): 'volatility',\n        ('OTHER', 'CONSOLIDATION', 'HIGH_VOL'): 'volume',\n        ('OTHER', 'CONSOLIDATION', 'LOW_VOL'): 'volume',\n        ('OTHER', 'DOWNTREND', 'HIGH_VOL'): 'trend',\n        ('OTHER', 'DOWNTREND', 'LOW_VOL'): 'momentum',\n        ('OTHER', 'UPTREND', 'HIGH_VOL'): 'volume',\n        ('OTHER', 'UPTREND', 'LOW_VOL'): 'momentum',\n    }\n    FALLBACK = 'volume'\n\n    def generate_signals(self, data):\n        champ_sigs = {}\n        for fam, strat in self._champion_strategies.items():\n            champ_sigs[fam] = strat.generate_signals(data)\n        signals = pd.Series(0, index=data.index)\n        for key, assigned in self.ROUTING.items():\n            if assigned not in champ_sigs:\n                assigned = self.FALLBACK\n            if assigned not in champ_sigs:\n                continue\n            session, trend, vol = key\n            mask = (\n                (data[\"session\"] == session)\n                & (data[\"trend_regime\"] == trend)\n                & (data[\"vol_regime\"] == vol)\n            )\n            signals[mask] = champ_sigs[assigned][mask]\n        return signals\n\n\n# -- 2D Regime Filter Applied --\n# Filtered (non-tradable) 2D buckets:\n#   (session=NY, trend=DOWNTREND): sharpe=-0.001, sufficient=True\n#   (session=ASIA, trend=DOWNTREND): sharpe=-0.024, sufficient=True\n#   (session=OTHER, trend=UPTREND): sharpe=-0.022, sufficient=True\n#   (session=LONDON, trend=UPTREND): sharpe=-0.000, sufficient=True\n#   (session=ASIA, trend=UPTREND): sharpe=-0.011, sufficient=True\n#   (session=NY, vol=LOW_VOL): sharpe=-0.023, sufficient=True\n#   (session=LONDON, vol=HIGH_VOL): sharpe=-0.017, sufficient=True\n#   (session=OTHER, vol=LOW_VOL): sharpe=-0.093, sufficient=True\n#   (trend=DOWNTREND, vol=LOW_VOL): sharpe=-0.021, sufficient=True\n#   (trend=UPTREND, vol=LOW_VOL): sharpe=-0.027, sufficient=True\n#\n# Bars in these regime combos have signals zeroed out.\n# Filter: tradable = sharpe > 0 AND sufficient_evidence == True\n# Gate: ALL 3 parent 2D buckets must be tradable\n",
